import React from "react";
import Input from "./Input";

function Form(props) {
  return (
    <form className="form">
      <Input
        type="text"
        placeholder="Username"
      />
      <Input
        type="password"
        placeholder="password"
      />

      {props.isRegisterd ==false && <Input type="password" placeholder="Confirm Password"/>}
      <button type="submit">
        {props.isRegisterd ? "Login" : "Register"}
      </button>
    </form>
  );
}

export default Form;
